auth_15_01_2016 = [{'rating': 7041, 'viewed': True, 'description': '', 'contents': [{'type': 'gif', 'pre_content': 'http://cs8.pikabu.ru/post_img/2016/01/15/7/1452852434175173718.jpg', 'content': 'http://cs8.pikabu.ru/post_img/2016/01/15/7/1452852434175173718.gif'}], 'friendsViewed': ['user1', 'user2', 'user3'], 'p_id': 3922752, 'timestamp': '2016-01-15T13:41:26Z', 'commentsCount': 707, 'post_link': 'http://pikabu.ru/story/kogda_pokupaesh_prezervativyi_v_pervyiy_raz_3922752', 'title': 'Когда покупаешь презервативы в первый раз'}, {'rating': 5564, 'viewed': True, 'description': '', 'contents': [{'type': 'img', 'pre_content': '', 'content': 'http://cs8.pikabu.ru/post_img/2016/01/15/5/1452837834132820255.jpg'}], 'friendsViewed': ['user1', 'user2', 'user3'], 'p_id': 3922162, 'timestamp': '2016-01-15T09:35:52Z', 'commentsCount': 329, 'post_link': 'http://pikabu.ru/story/tak_vot_ono_chto_3922162', 'title': 'Так вот оно что'}, {'rating': 5367, 'viewed': True, 'description': '', 'contents': [{'type': 'img', 'pre_content': '', 'content': 'http://cs8.pikabu.ru/post_img/2016/01/15/5/1452844655220191713.jpg'}], 'friendsViewed': ['user1', 'user2', 'user3'], 'p_id': 3922431, 'timestamp': '2016-01-15T11:41:29Z', 'commentsCount': 114, 'post_link': 'http://pikabu.ru/story/khitryiy_plan_3922431', 'title': 'Хитрый план.'}, {'rating': 5228, 'viewed': True, 'description': '', 'contents': [{'type': 'img', 'pre_content': '', 'content': 'http://cs8.pikabu.ru/post_img/2016/01/15/9/1452870931127473858.jpg'}, {'type': 'p', 'pre_content': '', 'content': "\n\t\t\t\t\t\t\t\t<p></p><p>Все время меня интересовало, что же они там сверлят? Сегодня на одном из форумов нашел ответ. Вот так, один из жильцов дома решил 'утеплить стену', множество дырок и залитая туда монтажная пена. Тег 'мое' ставить не буду, фотку сделал сам сосед.</p><p></p>\n\t\t\t\t\t\t\t"}], 'friendsViewed': ['user1', 'user2', 'user3'], 'p_id': 3923530, 'timestamp': '2016-01-15T18:48:00Z', 'commentsCount': 785, 'post_link': 'http://pikabu.ru/story/tayna_sverlyashchego_soseda_raskryita_3923530', 'title': 'Тайна сверлящего соседа раскрыта.'}, {'rating': 5216, 'viewed': True, 'description': '', 'contents': [{'type': 'p', 'pre_content': '', 'content': "\n\t\t\t<p>Однажды в нашей мастерской кусок поролона упал в корыто станка, на котором до этого пилили кирпич. Он впитал воду вместе с кирпичной взвесью и стал выглядеть вполне себе кирпично. Тогда я отрезал от него все лишнее так, чтобы и габаритами он не отличался от кирпича, а потом высушил.\xa0</p><p>Я даже не подозревал на какие манёвры способен человек, которому неожиданно крикнули 'Лови кирпич!', одновременно метнув в него этот кусок поролона. Протестировав рефлексы самосохранения по очереди у всех ребят из мастерской мы стали приветствовать этим кирпичом гостей )) Кто бы мог подумать сколько ужаса и радости может принести такая, в общем-то, скучная вещь, как кусок поролона.</p>\n\t\t\t\t"}], 'friendsViewed': ['user1', 'user2', 'user3'], 'p_id': 3922237, 'timestamp': '2016-01-15T10:19:41Z', 'commentsCount': 279, 'post_link': 'http://pikabu.ru/story/malenkie_radosti_skulptorov_3922237', 'title': 'Маленькие радости скульпторов'}, {'rating': 4948, 'viewed': True, 'description': '', 'contents': [{'type': 'p', 'pre_content': '', 'content': '\n\t\t\t\t\t\t\t\t<p></p><p>«<i>Не знаю, сможете ли вы сделать объявление, но если это возможно, то скажите, что кто бы ни пeрдeл в районе рядов с 10-го по 12-ый, ему определенно следует сходить к врачам, потому что у него вполне вероятен рак жoпы.</i>»</p><p></p>\n\t\t\t\t\t\t\t'}, {'type': 'img', 'pre_content': '', 'content': 'http://cs8.pikabu.ru/post_img/2016/01/15/4/1452831511117767939.png'}], 'friendsViewed': ['user1', 'user2', 'user3'], 'p_id': 3922053, 'timestamp': '2016-01-15T07:56:28Z', 'commentsCount': 170, 'post_link': 'http://pikabu.ru/story/zapiska_na_salfetke_peredannaya_styuardesse_rasstroennyim_passazhirom_3922053', 'title': 'Записка на салфетке, переданная стюардессе расстроенным пассажиром'}, {'rating': 4686, 'viewed': True, 'description': '', 'contents': [{'type': 'p', 'pre_content': '', 'content': '\n\t\t\t<p>Подрабатывал я летом на заводе. Как-то раз пошел слушок по цеху, что соседний заброшенный цех сдали в аренду каким-то кондитерам, а те, в свою очередь, приглашают работяг в гости за дешевыми сластями. И стал начальник цеха замечать, что женщины, а потом и мужики начали в тот цех бегать, да с полными сумками возвращаться. Собрался он с мыслями, и пошел туда на разведку. Кондитеры производили конфеты разные, брака много, выбрасывать жалко, вот и поставили они брак по дармовым ценам от 30 (карамель) до 90 (очень вкусные конфеты, что в магазинах под 350-500 руб/кг шли) рублей за килограмм шлака. Вернулся наш герой с разведки с двумя огромными пакетами крехтя и пыхтя.</p><p>-Ой, начальник! Чего же ты столько понабрал?! : встретили его гоготом суровые работники.</p><p>-Карамелек взял.</p><p>-Сколько взял то?</p><p>-24 килограмма, еле донес.</p><p>-Куда тебе столько, дурак? Слипнется же в одном месте!</p><p>-Ну сахар в магазине уже по 50 рублей, а тут карамельки по 30. Брагу то на чем-то ставить надо!</p><p>Гогот стих моментально и перешел в шуршание собирающихся за карамельками мужиков.</p><p>-Отбой! Всем работать! Нет там больше карамелек! Я все скупил, следующая партия только через неделю и я её застолбил!</p><p>P.S. И я там был, конфеты кушал, слипшиеся, вкусные, дешевые!<br/></p>\n\t\t\t\t'}], 'friendsViewed': ['user1', 'user2', 'user3'], 'p_id': 3921806, 'timestamp': '2016-01-15T01:32:53Z', 'commentsCount': 195, 'post_link': 'http://pikabu.ru/story/vyigoda_pomuzhski_3921806', 'title': 'Выгода по-мужски'}, {'rating': 4605, 'viewed': True, 'description': '', 'contents': [{'type': 'img', 'pre_content': '', 'content': 'http://cs8.pikabu.ru/post_img/2016/01/15/6/145284885416076878.jpg'}], 'friendsViewed': ['user1', 'user2', 'user3'], 'p_id': 3922597, 'timestamp': '2016-01-15T12:38:33Z', 'commentsCount': 397, 'post_link': 'http://pikabu.ru/story/salat_gotov_3922597', 'title': 'Салат готов!'}, {'rating': 4342, 'viewed': True, 'description': '', 'contents': [{'type': 'p', 'pre_content': '', 'content': '\n\t\t\t\t\t\t\t\t<p></p><p>Чистый двор, снег убран, лёд со ступеней сбит, около подъезда чисто, мусорные урны пустые. Вот это работа с ответственностью, без системы ЖКХ и бюрократии, несмотря на морозы.</p><p></p>\n\t\t\t\t\t\t\t'}, {'type': 'img', 'pre_content': '', 'content': 'http://cs8.pikabu.ru/post_img/2016/01/15/5/1452844057150475605.jpg'}, {'type': 'img', 'pre_content': '', 'content': 'http://cs8.pikabu.ru/post_img/2016/01/15/5/14528440781298926.jpg'}], 'friendsViewed': ['user1', 'user2', 'user3'], 'p_id': 3922373, 'timestamp': '2016-01-15T11:18:11Z', 'commentsCount': 274, 'post_link': 'http://pikabu.ru/story/slomal_sistemu_sistemu_nashego_zhkkh_3922373', 'title': 'Сломал систему, систему нашего ЖКХ'}, {'rating': 4148, 'viewed': True, 'description': '', 'contents': [{'type': 'p', 'pre_content': '', 'content': '\n\t\t\t<p>Сидим с тестем выпиваем, он рассказывает про своего родного брата:</p><p>-Вот я его из дерьма в молодости вытащил, а он неблагодарный какой вырос!</p><p>Тесть уже в кондиции,уточнять без толку что он там для брата в своё время сделал, тут как раз тёща заходит из комнаты :</p><p>-Что уже до дерьма дошло?\xa0</p><p>Оказывается когда тесть с братом были ещё мелкими пиздюками они жили в частном доме и туалет был на улице типа сортир, вот младший пошёл как то по нужде и провалился, а тесть его вытащил. С тех пор как выпьет всегда заявляет что вытащил брата из дерьма.</p><p>-</p>\n\t\t\t\t'}], 'friendsViewed': ['user1', 'user2', 'user3'], 'p_id': 3922708, 'timestamp': '2016-01-15T13:26:44Z', 'commentsCount': 53, 'post_link': 'http://pikabu.ru/story/glavnoe_kak_prepodnesti_3922708', 'title': 'Главное как преподнести'}, {'rating': 4117, 'viewed': True, 'description': '', 'contents': [{'type': 'p', 'pre_content': '', 'content': '\n\t\t\t<p>она: — А чего ты усы не отпустишь?</p><p>он: — Да я с ними какой-то стремный.</p><p>она: — Думаешь, дело в усах?</p><p>он: — С парнем так своим будешь разговаривать!</p><p>она: — У меня нет парня.</p><p>он: — Думаешь, дело в усах?</p>\n\t\t\t\t'}], 'friendsViewed': ['user1', 'user2', 'user3'], 'p_id': 3922951, 'timestamp': '2016-01-15T14:56:26Z', 'commentsCount': 89, 'post_link': 'http://pikabu.ru/story/delo_v_usakh_3922951', 'title': 'Дело в усах'}, {'rating': 4104, 'viewed': True, 'description': '', 'contents': [{'type': 'img', 'pre_content': '', 'content': 'http://cs8.pikabu.ru/post_img/2016/01/15/5/1452840784126713381.jpg'}], 'friendsViewed': ['user1', 'user2', 'user3'], 'p_id': 3922254, 'timestamp': '2016-01-15T10:25:42Z', 'commentsCount': 116, 'post_link': 'http://pikabu.ru/story/vstrecha_na_yutube_3922254', 'title': 'Встреча на ютубе.'}, {'rating': 4032, 'viewed': True, 'description': '', 'contents': [{'type': 'img', 'pre_content': '', 'content': 'http://cs8.pikabu.ru/post_img/2016/01/15/6/1452845561154148354.png'}], 'friendsViewed': ['user1', 'user2', 'user3'], 'p_id': 3922459, 'timestamp': '2016-01-15T11:52:34Z', 'commentsCount': 100, 'post_link': 'http://pikabu.ru/story/lingvist_3922459', 'title': 'Лингвист'}, {'rating': 3956, 'viewed': True, 'description': '', 'contents': [{'type': 'img', 'pre_content': '', 'content': 'http://cs8.pikabu.ru/post_img/2016/01/15/2/1452818345190348499.jpg'}, {'type': 'p', 'pre_content': '', 'content': '\n\t\t\t\t\t\t\t\t<p></p><p>Думаю новость не новая, но всё равно скину, может не видел=)</p><p></p>\n\t\t\t\t\t\t\t'}], 'friendsViewed': ['user1', 'user2', 'user3'], 'p_id': 3921942, 'timestamp': '2016-01-15T04:10:06Z', 'commentsCount': 283, 'post_link': 'http://pikabu.ru/story/delo_govorit_3921942', 'title': 'Дело говорит.'}, {'rating': 3954, 'viewed': True, 'description': '', 'contents': [{'type': 'p', 'pre_content': '', 'content': "\n\t\t\t<p>Одногруппнице её молодой человек подарил фитнес - браслет. Сегодня сидит, смотрит свою активность в приложении и говорит: 'Обидно, когда браслет занятие сексом воспринял, как глубокий сон'. Вся аудитория каталась от смеха)</p>\n\t\t\t\t"}], 'friendsViewed': ['user1', 'user2', 'user3'], 'p_id': 3922260, 'timestamp': '2016-01-15T10:29:04Z', 'commentsCount': 61, 'post_link': 'http://pikabu.ru/story/brevno_3922260', 'title': 'Бревно'}, {'rating': 3901, 'viewed': True, 'description': '', 'contents': [{'type': 'p', 'pre_content': '', 'content': "\n\t\t\t<p>Форум о сексе, тема 'Заставили ли вас родители за этим? Знают ли они о том, что вы этим занимаетесь?'\xa0Один из ответов: 'Нет, родители не заставали за этим никогда - ни мои, ни ее, насчет знают не в курсе, но мы боимся, что они обо всем знают или хотя бы догадываются, глядя на внуков'</p>\n\t\t\t\t"}], 'friendsViewed': ['user1', 'user2', 'user3'], 'p_id': 3923110, 'timestamp': '2016-01-15T15:58:45Z', 'commentsCount': 94, 'post_link': 'http://pikabu.ru/story/forum_o_sekse_3923110', 'title': 'Форум о сексе'}, {'rating': 3899, 'viewed': True, 'description': '', 'contents': [{'type': 'p', 'pre_content': '', 'content': '\n\t\t\tСотрудники МЧС во время тренировочных подводных спусков нашли в реке Енисей в Центральном районе Красноярска автомобиль Mitsubishi с телами мужчины и женщины, предположительно, пропавших 20 лет назад.\n\t\t\t\t'}], 'friendsViewed': ['user1', 'user2', 'user3'], 'p_id': 3922126, 'timestamp': '2016-01-15T09:04:39Z', 'commentsCount': 170, 'post_link': 'http://pikabu.ru/story/kogda_ucheniya_proshli_deystvitelno_uspeshno_3922126', 'title': 'Когда учения прошли действительно успешно'}, {'rating': 3836, 'viewed': True, 'description': '', 'contents': [{'type': 'img', 'pre_content': '', 'content': 'http://cs8.pikabu.ru/post_img/2016/01/15/7/145285365519163728.jpg'}], 'friendsViewed': ['user1', 'user2', 'user3'], 'p_id': 3922805, 'timestamp': '2016-01-15T14:03:42Z', 'commentsCount': 55, 'post_link': 'http://pikabu.ru/story/pravilnyiy_podkhod_3922805', 'title': 'Правильный подход'}, {'rating': 3739, 'viewed': True, 'description': '', 'contents': [{'type': 'p', 'pre_content': '', 'content': '\n\t\t\t\t\t\t\t\t<p></p><p>Теперь каждый вечер буду ходить в поход.</p><p></p>\n\t\t\t\t\t\t\t'}, {'type': 'gif', 'pre_content': 'http://cs8.pikabu.ru/post_img/2016/01/15/3/145283021111635825.jpg', 'content': 'http://cs8.pikabu.ru/post_img/2016/01/15/3/145283021111635825.gif'}], 'friendsViewed': ['user1', 'user2', 'user3'], 'p_id': 3922031, 'timestamp': '2016-01-15T07:32:44Z', 'commentsCount': 161, 'post_link': 'http://pikabu.ru/story/uvidel_yetu_butyilku_v_magazine_nazyivaetsya_pokhodnaya_3922031', 'title': 'Увидел эту бутылку в магазине. Называется походная.'}]

